import axios from "axios";
export const RegisterApi = (inputs) => {
  let data = {
    displayName: inputs.name,
    email: inputs.email,
    mobileNumber: inputs.mobileNumber,
    password: inputs.password,
  };
  return axios.post("http://localhost:3055/api/user/register", data);
};
